$values.ValueExpression:
@prefix object: <http://comindware.com/ontology/object#>.
@prefix cmwstring: <http://comindware.com/logics/string#>.
@prefix ui: <http://comindware.com/ontology/ui#>.
@prefix account: <http://comindware.com/ontology/account#>.

{
    ("Workitem" "Performers") object:findProperty ?PerformersProp.
    
    from{
       ?item ?PerformersProp ?PerformersVal.
	   ?PerformersVal account:displayName ?PerformersName.
       ?PerformersName ui:toClientString ?idStringValue.
    } select ?idStringValue -> ?stringValues.
    (";" ?stringValues) cmwstring:join ?value.
}

